import React from "react";

function Header() {
  return (
    <header className="header">
      <div className="header__logo" />
      {name === "sign-up" ? (
        <Link to="sign-in" className="...">
          Войти
        </Link>
      ) : name === "sign-in" ? (
        <Link to="sign-in" className="...">
          Регистрация
        </Link>
      ) : (
        ''
      )}
    </header>
  );
}

export default Header;
